query CommitsController__ShowGraphqlHTMLQuery($id: ID!, $revision: String!, $after: String, $path: String, $author: Author, $since: GitTimestamp, $until: GitTimestamp) {
  node(id: $id) {
    __typename
    ... on Repository {
      name
      owner {
        __typename
        login
      }
      commit: object(expression: $revision) {
        __typename
        ... on Commit {
          oid
          history(first: 35, after: $after, path: $path, author: $author, since: $since, until: $until) {
            pageInfo {
              hasNextPage
            }
            edges {
              cursor
              node {
                oid
                message
                messageBodyHTML
                messageHeadlineHTML
                websocket
                repository {
                  name
                  owner {
                    __typename
                    ... on Node {
                      id
                    }
                    login
                  }
                }
                author {
                  date
                  name
                  email
                  user {
                    id
                    login
                    avatarURL(size: 72)
                  }
                }
                committer {
                  date
                  name
                  email
                  user {
                    id
                    login
                    avatarURL(size: 32)
                  }
                }
                comments(first: 1) {
                  totalCount
                }
                status {
                  ...Statuses__GraphqlIconView__StatusIcon
                }
                signature {
                  __typename
                  ...Views__Commits__SignedCommitBadge__GitSignature
                }
              }
            }
          }
        }
      }
    }
  }
}

